import React from 'react';
import MyPlace from '../specific/MyPlace';
import TotalRoute from '../specific/TotalRoute';

function CreateMyCourse() {
    return (
        <div>
            <main>
                <MyPlace />
                <TotalRoute />
            </main>
        </div>
    );
}

export default CreateMyCourse;
